"use strict";
describe("Unit conversion", function () {
    it("Animate x from 0 to calc", function () {
        cy.visit("?test=unit-conversion")
            .wait(100)
            .get("#box")
            .trigger("click")
            .wait(100)
            .should(function (_a) {
            var $box = _a[0];
            var left = $box.getBoundingClientRect().left;
            expect(left).to.equal(150);
        });
    });
});
